import React, { useState, useEffect } from 'react';
import axios from 'axios';

function VehicleList({ vehicles = [] }) {
  const [vehicleData, setVehicleData] = useState(vehicles);
  const [editingVehicle, setEditingVehicle] = useState(null);
  const [formData, setFormData] = useState({
    make: '',
    model: '',
    year: '',
    rental_price: ''
  });

  useEffect(() => {
    setVehicleData(vehicles);
  }, [vehicles]);

  // Handle form data change
  const handleInputChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  // Handle form submit for creating or editing a vehicle
  const handleFormSubmit = async (e) => {
    e.preventDefault();

    if (editingVehicle) {
      // Edit vehicle
      try {
        await axios.put(`http://localhost:5000/api/vehicles/${editingVehicle._id}`, formData);
        setVehicleData(vehicleData.map(vehicle => vehicle._id === editingVehicle._id ? { ...vehicle, ...formData } : vehicle));
        setEditingVehicle(null);
      } catch (error) {
        console.error('Error updating vehicle', error);
      }
    } else {
      // Add new vehicle
      try {
        const response = await axios.post('http://localhost:5000/api/vehicles', formData);
        setVehicleData([...vehicleData, response.data]);
      } catch (error) {
        console.error('Error adding vehicle', error);
      }
    }

    setFormData({ make: '', model: '', year: '', rental_price: '' }); // Clear form after submit
  };

  // Handle Delete
  const handleDelete = async (vehicleId) => {
    try {
      await axios.delete(`http://localhost:5000/api/vehicles/${vehicleId}`);
      setVehicleData(vehicleData.filter(vehicle => vehicle._id !== vehicleId));
    } catch (error) {
      console.error('Error deleting vehicle', error);
    }
  };

  // Handle Edit
  const handleEdit = (vehicle) => {
    setEditingVehicle(vehicle);
    setFormData({
      make: vehicle.make,
      model: vehicle.model,
      year: vehicle.year,
      rental_price: vehicle.rental_price
    });
  };

  return (
    <div className="dashboard-container">
      <Sidebar />
      <div className="main-content">
        <h2>Vehicles</h2>

        {/* Vehicle Form for Add/Edit */}
        <form onSubmit={handleFormSubmit} className="vehicle-form">
          <input
            type="text"
            name="make"
            placeholder="Make"
            value={formData.make}
            onChange={handleInputChange}
            required
          />
          <input
            type="text"
            name="model"
            placeholder="Model"
            value={formData.model}
            onChange={handleInputChange}
            required
          />
          <input
            type="number"
            name="year"
            placeholder="Year"
            value={formData.year}
            onChange={handleInputChange}
            required
          />
          <input
            type="number"
            name="rental_price"
            placeholder="Rental Price"
            value={formData.rental_price}
            onChange={handleInputChange}
            required
          />
          <button type="submit">{editingVehicle ? 'Update Vehicle' : 'Add Vehicle'}</button>
        </form>

        {/* Table for Vehicles */}
        <div className="table-container">
          <table>
            <thead>
              <tr>
                <th>Make</th>
                <th>Model</th>
                <th>Year</th>
                <th>Rental Price</th>
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              {vehicleData.length > 0 ? (
                vehicleData.map((vehicle) => (
                  <tr key={vehicle._id}>
                    <td>{vehicle.make}</td>
                    <td>{vehicle.model}</td>
                    <td>{vehicle.year}</td>
                    <td>{vehicle.rental_price}</td>
                    <td>
                      <button onClick={() => handleEdit(vehicle)}>Edit</button>
                      <button onClick={() => handleDelete(vehicle._id)}>Delete</button>
                    </td>
                  </tr>
                ))
              ) : (
                <tr>
                  <td colSpan="5">No vehicles found</td>
                </tr>
              )}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}

export default VehicleList;
